#include <Modules/Visualization/TextBuilder.h>

using namespace SCIRun::Modules::Visualization;
using namespace SCIRun::Core::Geometry;

TextBuilder::TextBuilder(const char * text, const double scale,
            const Core::Geometry::Vector shift)
: text_(text), scale_(scale), shift_(shift) {
    
}

void TextBuilder::getStringVerts(std::vector<Core::Geometry::Vector> &verts,  std::vector<Core::Geometry::Vector> &colors) {
    Vector shift = shift_;
    for (auto a : text_) {
        std::vector<Vector> tmp;
        std::vector<Vector> tmp2;
        getCharVerts(a, tmp,tmp2);
        for (auto v : tmp) {
            verts.push_back(v + shift);
        }
        for (auto v : tmp2) {
            colors.push_back(v);
        }
        shift = shift + Vector(scale_,0.,0.);
    }
}

void TextBuilder::getCharVerts(const char c, std::vector<Core::Geometry::Vector> &verts,
                                std::vector<Core::Geometry::Vector> &colors) {
    char idx = c - 32;
    if (idx < 0 || idx >= 96) idx = 95;
    //get the offset into the font array.
    size_t row = idx / 16;
    size_t col = c % 16;
    size_t pixel_row = row * 64;
    size_t pixel_col = col * 64;
    const uint16_t *font = font0_;
    size_t resolution = 128;
    for (size_t i = 0; i < resolution; i++) {
        for (size_t j = 0; j < resolution; j++) {
            //sample resolution x resolution across the square of the current letter.
            size_t sample_x = 2+pixel_col + static_cast<size_t>(60. * static_cast<double>(j) /
                                                    static_cast<double>(resolution)+.5);
            size_t sample_y = 2+pixel_row + static_cast<size_t>(60. * static_cast<double>(i) /
                                                    static_cast<double>(resolution)+.5);
            uint16_t pixel = 0;//font[sample_y*1024 + sample_x];
            //anti-alias
            for(int u = -1; u <= 0; u++) {
                for (int v = -1; v <= 0; v++) {
                    size_t sub_x = std::min(std::max((size_t)0,u+sample_x),(size_t)1023);
                    size_t sub_y = std::min(std::max((size_t)0,v+sample_y),(size_t)384);
                    uint16_t pixel2 = font[sub_y*1024 + sub_x];
                    pixel = ((pixel & 0xff00) + ((((pixel2 >> 8) / 4) << 8) & 0xff00)) |
                                ((pixel & 0x00ff) + ((pixel2 & 0x00ff) / 4));
                }
            }
            unsigned char val = (pixel >> 8) & 0x00ff;
            unsigned char alpha = pixel & 0x00ff;
            if (alpha > 100) {
                verts.push_back(scale_ * Vector(static_cast<double>(j),resolution-static_cast<double>(i),0.) / static_cast<double>(resolution));
                colors.push_back(Vector(static_cast<float>(val)/255.f,static_cast<float>(alpha) / 255.f,0.));
            }
        }
    }
}

void TextBuilder::reset(const char * text, const double scale,
            const Core::Geometry::Vector shift) {
    text_ = text;
    scale_ = scale;
    shift_ = shift;
}

